import AppLayout from "../components/AppLayout";
import { Card, Input } from 'antd';
import { EditOutlined, UploadOutlined  } from '@ant-design/icons';
const { Meta } = Card;

const NewLook = () => {
    return(
        <AppLayout >
            <h1>New DailyLook</h1>
            
            <section >
            <Card
                style={{
                width: 280,
                position: 'fixed'
                }}
                cover={<img style={{height: 600}} alt="example" src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png" />}
                actions={[
                    
                    <EditOutlined key="edit" />,
                    <UploadOutlined />
                    
                  ]}
             >
                <Meta description="Today's look" />
            </Card>
            
            <div style={{position: 'fixed', marginLeft: 300}}>
                <ul>
                <li style={{display: 'inline-block'}}><h3 >데일리룩 제목</h3></li>
                <li style={{display: 'inline-block'}}><Input showCount maxLength={20} /></li>
                </ul>
                <br />
                <h3>카테고리</h3>
                </div>
            </section>
            <section >
                
                
            </section>
        </AppLayout>
    );
};

export default NewLook;
